import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Home from "./Home.jsx";



const darkTheme = createTheme({
  palette: {
    type: 'dark',
  },
});

function App() {
  return (
    <div className="App">
      <Router>
        <Navigation />
        <Switch>
          <Route path="/" exact component={() => <Home />} />
        </Switch>
      </Router>
    </div>
  );
};

export default App;
